import { NavLink } from "react-router-dom";
import React from 'react';

export const Navbar = () => {
  return (
    <>
    <div className="menu">
        <i title="edit item" className="fa fa-book edit1" area-hidden="true"></i>
        <NavLink className='navlink' exact activeClassName = 'active_class' to = '/'>ToDo List</NavLink>
        {/* <NavLink className='navlink' exact activeClassName = 'active_class' to = '/about'>About</NavLink> */}
    </div>
    </>
  );
};

export default Navbar;
